import {connect} from "react-redux"
const CakeContainer = () => {
  return (
    <div>
        <h2>Number of Cakes</h2>
        <button>Buy  Cake</button>
    </div>
  )
}

const mapStateToProps=state=>{
    return{
        numofCakes:state.numofCakes
    }
}

export default connect(mapStateToProps())
